// SPDX-License-Identifier: MIT
pragma solidity 0.8.4;

import { Staking } from "../Staking.sol";

contract CappableStaking is Staking {
    uint256 public cap;

    event CapChange(uint256 oldCap, uint256 newCap);

    constructor(
        address _stakingToken,
        address _rewardToken,
        uint256 _rewardAmount,
        uint256 _startTime,
        uint256 _stopTime,
        uint256 _cap
    ) Staking(_stakingToken, _rewardToken, _rewardAmount, _startTime, _stopTime) {
        cap = _cap;
    }

    modifier capped(uint256 _amount) {
        require(totalStaked + _amount <= cap, "Staking: over cap limit");
        _;
    }

    function stake(uint256 _amount) public override capped(_amount) {
        super.stake(_amount);
    }

    function setCap(uint256 _newCap) public onlyOwner {
        require(_newCap >= totalStaked, "Staking: new cap less than already staked amount");
        uint256 oldCap = cap;
        cap = _newCap;
        emit CapChange(oldCap, _newCap);
    }
}
